var triesrem=20;
function doarr() {
    if(PIXI?.utils?.TextureCache[arr[0]]) {
        for(var i=0;i+1 < arr.length; i+=2) {
            PIXI.utils.TextureCache[arr[i]]
            =
            PIXI.Texture.fromImage(arr[i+1]);
        }
        return;
    }
 
    if(triesrem>0)  {
       triesrem--;
        setTimeout(doarr,1000);
    }
}
setTimeout(()=>doarr(),1000);
